  \"2015-07-23T03:28:08.226286\",\n\t\"name\": \"censusing-moose\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Because much of the range of moose is remote
  from population centers, and because large Moose populations have developed relatively
  recently, little effort has been expended in finding practical ways to census moose.
  The methods presently in use are aerial surveys and sex and age ratios. Other  techniques
  for censuring big game, however, have been developed, and these could probably be
  adapted for use in censuring moose. Aerial surveys and sex ratios, however, are
  not particularly suited to censuring moose in the parts of its range where the coniferous
  forest type prevails. Therefore, a new technique for censusing moose will be proposed
  in this paper. It is hoped that this method will be useful in censusing moose, particularly
  in the eastern portion of its range.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
